# %% [markdown]
# # The Fisher Two-Period Optimal Consumption Problem
#
# [![badge](https://img.shields.io/badge/Launch%20using%20-Econ--ARK-blue)](https://econ-ark.org/materials/fishertwoperiod#launch)

# %%
# Some initial setup
import ipywidgets as widgets
from ipywidgets import interact, fixed
from HARK.ConsumptionSaving.ConsIndShockModel import PerfForesightConsumerType
import numpy as np
from copy import deepcopy
from matplotlib import pyplot as plt
import seaborn as sns
sns.set_style("darkgrid")
palette = plt.get_cmap("Dark2")


def mystr(number):
    return "{:.3f}".format(number)


# %% [markdown]
# This notebook creates interactive widgets illustrating a two-period optimal consumption problem. It also presents graphic representations of the decomposition of the effect of interest rates into the income, substitution, and human wealth effects.

# %% [markdown]
# ### Basic Plot: the optimal $(c_1,c_2)$ bundle.

# %%
# The first step in creating a widget is defining
# a function that will receive the user's input as
# parameters and generate the entity that we want
# to analyze: in this case, a figure of the optimmal
# consumption bundle given income, assets, and interest
# rates


def FisherPlot(y_1, y_2, b_1, R, c_1max, c_2max):
    # Basic setup of perfect foresight consumer

    # We first create an instance of the class
    # PerfForesightConsumerType, with its standard parameters.
    PFexample = PerfForesightConsumerType()

    PFexample.cycles = 1  # let the agent live the cycle of periods just once
    PFexample.T_cycle = 2  # Number of periods in the cycle
    # No automatic growth in income across periods
    PFexample.PermGroFac = [1.0]
    PFexample.LivPrb = [1.0]  # No chance of dying before the second period
    PFexample.aNrmInitStd = 0.0
    PFexample.AgentCount = 1
    CRRA = PFexample.CRRA
    beta = PFexample.DiscFac

    # Set interest rate and bank balances from input.
    PFexample.Rfree = R
    PFexample.aNrmInitMean = b_1

    # Solve the model: this generates the optimal consumption function.

    # Try-except blocks "try" to execute the code in the try block. If an
    # error occurs, the except block is executed and the application does
    # not halt
    try:
        PFexample.solve()
    except:
        print("Those parameter values violate a condition required for solution!")

    # Create the figure
    c_1min = 0.0
    c_2min = 0.0
    plt.figure(figsize=(8, 8))
    plt.xlabel("Period 1 Consumption $c_1$")
    plt.ylabel("Period 2 Consumption $c_2$")
    plt.ylim([c_2min, c_2max])
    plt.xlim([c_1min, c_1max])

    # Plot the budget constraint
    c_1_bc = np.linspace(c_1min, b_1 + y_1 + y_2 / R, 10, endpoint=True)
    c_2_bc = (y_1 + b_1 - c_1_bc) * R + y_2
    plt.plot(c_1_bc, c_2_bc, "k-", label="Budget Constraint")

    # Plot the optimal consumption bundle
    c_1 = PFexample.solution[0].cFunc(b_1 + y_1 + y_2 / R)
    c_2 = PFexample.solution[1].cFunc((y_1 + b_1 - c_1) * R + y_2)
    plt.plot(c_1, c_2, "ro", label="Optimal Consumption")

    # Plot the indifference curve
    V = c_1 ** (1 - CRRA) / (1 - CRRA) + beta * c_2 ** (1 - CRRA) / (
        1 - CRRA
    )  # Get max utility
    c_1_V = np.linspace(((1 - CRRA) * V) ** (1 / (1 - CRRA)) + 0.5, c_1max, 1000)
    c_2_V = (((1 - CRRA) * V - c_1_V ** (1 - CRRA)) / beta) ** (1 / (1 - CRRA))
    plt.plot(c_1_V, c_2_V, "b-", label="Indiferrence Curve")

    # Add a legend and display the plot
    plt.legend()
    plt.show()

    return None


# %%
# We now define the controls that will receive and transmit the
# user's input.
# These are sliders for which the range, step, display, and
# behavior are defined.

# Define a slider for the interest rate
Rfree_widget = widgets.FloatSlider(
    min=1.0,
    max=2.0,
    step=0.001,
    value=1.05,
    continuous_update=True,
    readout_format=".2f",
    description="$R$",
)

# Define a slider for y_1
y_1_widget = widgets.FloatSlider(
    min=0.0,
    max=100.0,
    step=0.1,
    value=50.0,
    continuous_update=True,
    readout_format=".1f",
    description="$y_1$",
)

# Define a slider for y_2
y_2_widget = widgets.FloatSlider(
    min=0.0,
    max=100.0,
    step=0.1,
    value=50.0,
    continuous_update=True,
    readout_format=".1f",
    description="$y_2$",
)

# Define a slider for b_1
b_1_widget = widgets.FloatSlider(
    min=0.0,
    max=4.0,
    step=0.01,
    value=2.0,
    continuous_update=True,
    readout_format=".2f",
    description="$b_1$",
)

# Define a textbox for c_1 max
c_1max_widget = widgets.FloatText(
    value=120, step=1.0, description="$c_1$ max", disabled=False
)

# Define a textbox for c_2 max
c_2max_widget = widgets.FloatText(
    value=120, step=1.0, description="$c_2$ max", disabled=False
)

# %%
# Make the widget
interact(
    FisherPlot,
    y_1=y_1_widget,
    y_2=y_2_widget,
    b_1=b_1_widget,
    R=Rfree_widget,
    c_1max=c_1max_widget,
    c_2max=c_2max_widget,
)

# %% [markdown]
# ### Second plot: interest rate shifts with lifetime income earned in first period.

# %%
# This follows the same process as the previous plot, but now the problem
# is solved at two different interest rates in order to illustrate their effect.


# Define a function that plots something given some bits
def FisherPlot1(y_1, y_2, b_1, R_Init, R_New, c_1max, c_2max):
    # Basic setup of perfect foresight consumer
    PFexample = (
        PerfForesightConsumerType()
    )  # set up a consumer type and use default parameteres
    PFexample.cycles = 1  # let the agent live the cycle of periods just once
    PFexample.T_cycle = 2  # Number of periods in the cycle
    # No automatic growth in income across periods
    PFexample.PermGroFac = [1.0]
    PFexample.LivPrb = [1.0]  # No chance of dying before the second period
    PFexample.aNrmInitStd = 0.0
    PFexample.AgentCount = 1
    CRRA = 2.0
    beta = PFexample.DiscFac

    # Set the parameters we enter
    PFexample.aNrmInitMean = b_1

    # Create two models, one for RfreeHigh and one for RfreeLow
    PFexampleR_Init = deepcopy(PFexample)
    PFexampleR_Init.Rfree = R_Init
    PFexampleR_New = deepcopy(PFexample)
    PFexampleR_New.Rfree = R_New

    c_1min = 0.0
    c_2min = 0.0

    # Solve the model for RfreeHigh and RfreeLow
    try:
        PFexampleR_Init.solve()
        PFexampleR_New.solve()
    except:
        print("Those parameter values violate a condition required for solution!")

    # Plot the chart
    plt.figure(figsize=(8, 8))
    plt.xlabel("Period 1 Consumption $c_1$")
    plt.ylabel("Period 2 Consumption $c_2$")
    plt.ylim([c_2min, c_2max])
    plt.xlim([c_1min, c_1max])

    # Plot the budget constraints
    c_1_bc_R_New = np.linspace(c_1min, b_1 + y_1 + y_2 / R_New, 10, endpoint=True)
    c_2_bc_R_New = (y_1 + b_1 - c_1_bc_R_New) * R_New + y_2
    plt.plot(c_1_bc_R_New, c_2_bc_R_New, "k-", label="Budget Constraint R New")

    c_1_bc_R_Init = np.linspace(c_1min, b_1 + y_1 + y_2 / R_Init, 10, endpoint=True)
    c_2_bc_R_Init = (y_1 + b_1 - c_1_bc_R_Init) * R_Init + y_2
    plt.plot(c_1_bc_R_Init, c_2_bc_R_Init, "k--", label="Budget Constraint R Initial")

    # The optimal consumption bundles
    c_1_opt_R_New = PFexampleR_New.solution[0].cFunc(b_1 + y_1 + y_2 / R_New)
    c_2_opt_R_New = PFexampleR_New.solution[1].cFunc((y_1 + b_1 - c_1_opt_R_New) * R_New + y_2)

    c_1_opt_R_Init = PFexampleR_Init.solution[0].cFunc(b_1 + y_1 + y_2 / R_Init)
    c_2_opt_R_Init = PFexampleR_Init.solution[1].cFunc((y_1 + b_1 - c_1_opt_R_Init) * R_Init + y_2)

    # Plot the indifference curves
    V_R_New = c_1_opt_R_New ** (1 - CRRA) / (1 - CRRA) + beta * c_2_opt_R_New ** (1 - CRRA) / (
        1 - CRRA
    )  # Get max utility
    c_1_V_R_New = np.linspace(((1 - CRRA) * V_R_New) ** (1 / (1 - CRRA)) + 0.5, c_1max, 1000)
    c_2_V_R_New = (((1 - CRRA) * V_R_New - c_1_V_R_New ** (1 - CRRA)) / beta) ** (
        1 / (1 - CRRA)
    )
    plt.plot(c_1_V_R_New, c_2_V_R_New, "b-", label="Indiferrence Curve R New")

    V_R_Init = c_1_opt_R_Init ** (1 - CRRA) / (1 - CRRA) + beta * c_2_opt_R_Init ** (1 - CRRA) / (
        1 - CRRA
    )  # Get max utility
    c_1_V_R_Init = np.linspace(((1 - CRRA) * V_R_Init) ** (1 / (1 - CRRA)) + 0.5, c_1max, 1000)
    c_2_V_R_Init = (((1 - CRRA) * V_R_Init - c_1_V_R_Init ** (1 - CRRA)) / beta) ** (
        1 / (1 - CRRA)
    )
    plt.plot(c_1_V_R_Init, c_2_V_R_Init, "b--", label="Indiferrence Curve R Initial")

    # The substitution effect
    c_1_Subs = (
        V_R_Init * (1 - CRRA) / (1 + beta * (R_New * beta) ** ((1 - CRRA) / CRRA))
    ) ** (1 / (1 - CRRA))
    c_2_Subs = c_1_Subs * (R_New * beta) ** (1 / CRRA)

    c_1_bc_Subs = np.linspace(c_1min, b_1 + y_1 + y_2 / R_Init, 10, endpoint=True)
    c_2_bc_Subs = (c_1_Subs + c_2_Subs / R_New - c_1_bc_Subs) * R_New + y_2
    plt.plot(c_1_bc_Subs, c_2_bc_Subs, "k-")

    # Plot the points of interest
    plt.plot(c_1_opt_R_New, c_2_opt_R_New, "ro", label="A: Optimal Consumption R New")
    plt.plot(
        c_1_Subs,
        c_2_Subs,
        "go",
        label="B: Income effect AB \n     Substitution effect BC ",
    )
    plt.plot(c_1_opt_R_Init, c_2_opt_R_Init, "mo", label="C: Optimal Consumption R Initial")

    plt.legend()
    plt.show()

    return None


